import React from 'react';
import {Drawer as MaterialDrawer} from '@material-ui/core';
import Divider from '@material-ui/core/Divider';
import DrawerList from "./DrawerList";
import {withRouter} from "react-router-dom";
import styled from 'styled-components'
import ToolbarSpacer from "../../../common/ToolbarSpacer";

const drawerWidth = 240

const StyledDrawer = styled(({...props}) => (
    <MaterialDrawer {...props} />
))`
        width: ${drawerWidth};
        flex-shrink: 0;
        ${({theme}) => theme.paper`{width: ${drawerWidth}}`}
`;


const Drawer = (props) => {
    const items1 = ['Композиции',]
    const items2 = ['Предложить']
    const items3 = ['Что-то...']

    return (
        <StyledDrawer
            variant="permanent"
        >
            <ToolbarSpacer/>
            <DrawerList items={items1}/>
            <DrawerList items={items2}/>
            <Divider/>
            <DrawerList items={items3}/>
        </StyledDrawer>
    );
}

export default withRouter(Drawer)
